import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import MapComponent from './components/MapComponent';
import Login from './components/Login';
import Home from './components/Home';
import Register from './components/Register';
import UpdatePerson from './components/UpdatePerson';
import NotFound from './components/NotFound'; // Asegúrate de crear este componente

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} /> {/* Ruta para Home */}
          <Route path="/login" element={<Login />} /> {/* Ruta para Login */}
          <Route path="/register" element={<Register />} /> {/* Ruta para Registro */}
          <Route path="/map" element={<MapComponent />} /> {/* Ruta para Mapa */}
          <Route path="/update/:id" element={<UpdatePerson />} /> {/* Ruta para Actualizar Persona */}
          <Route path="*" element={<NotFound />} /> {/* Ruta para manejar 404 */}
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
